    the Party during this reporting period, we identified and reclassified $1,852.73
    as allocated expenses between the federal and non-federal accounts.  During the
    reconciliation, we also identified $100 dollars in additional contributions reported
    on Schedule A line 11a ii and additional expenditures in the amount of $150, reported
    on Schedule B, Line 21 b.  The net change in cash on hand is a decrease of $50.    Allocated
    activity reported on H4 year to date totals are correct on lines 21ai and 21aii.    As
    a result of software upgrade on March 5, 2007, we are no longer able to sort our
    data based on date of expenditure.   The software program however, reflects a
    date total on each record.  Consequently, each record shows a  year to date total
    for the type of activity based on date, but the random reporting by name of the
    expenditures, makes the year to date totals appear incorrect.  After careful reconciliation
    of each activity, the totals reflected on lines 21ai and 21aii are correct for
    the allocated expenditures.  All transfers which were not made within the 70 day
    time period have been returned to the non-federal account as previously reported"'
